function findNearest(lat, lng, lats, lngs, prices) {
	var out = new Array();
	var shortest = 10;
	var index = -1;
	for (var i = 0; i < lngs.length; i++) {
		var distance = distCal(lat, lng, lats[i], lngs[i]);
		if (distance < shortest) {
			shortest = distance;
			index = i;
		}
	}
	out[0] = prices[index];
	out[1] = index;
	return out;
}

function distCal(lat, lng, lat2, lng2) {
	latr = lat * Math.PI / 180;
	lngr = lng * Math.PI / 180;
	var latd = Math.abs(lat2 * Math.PI / 180 - latr);
	var lngd = Math.abs(lng2 * Math.PI / 180 - lngr);
	var lath = Math.sin(latd / 2);
	var lngh = Math.sin(lngd / 2);

	var h = lath * lath + Math.cos(latd) * Math.cos(lngd) * lngh * lngh;
	var distance = 2 * 6371.0 * Math.asin(Math.sqrt(h));
	return distance;
}

